INSERT INTO `services` (`id`, `title`, `slug`, `code`, `short_title`, `main_image`, `created_at`, `updated_at`) VALUES
(3, 'Business Portraits', 'business-portraits', NULL, 'A professional business portrait can help convey a sense of professionalism and credibility to potential clients or customers. It can also help establish trust and build a personal connection with clients or customers. It can be used as part of a company\'s branding and marketing efforts. A well-crafted portrait can help communicate the values and personality of a company or individual.</p><p>A business portrait can be used as part of a company\'s branding and marketing efforts. A well-crafted portrait can help communicate the values and personality of a company or individual. In today\'s digital age, many people will encounter a company or individual online before meeting them in person. A professional business portrait can be used as a profile picture on social media, on a website, or in an email signature, to help make a good first impression. It can also used for networking purposes. For example, you can use it on business cards, LinkedIn, or on your website<br></p>', 'upload/services/168077449313.jpg', '2023-04-06 09:48:13', '2023-04-06 12:32:53'),
(8, 'Maternity', 'maternity', NULL, NULL, 'upload/services/168197599912.jpg', '2023-04-20 07:33:19', '2023-04-20 07:33:19'),
(9, 'Family', 'family', NULL, NULL, 'upload/services/16819760361.jpg', '2023-04-20 07:33:56', '2023-04-20 07:33:56'),
(10, 'Baby', 'baby', NULL, NULL, 'upload/services/168197608421.jpg', '2023-04-20 07:34:45', '2023-04-20 07:34:45'),
(11, 'Kids', 'kids', NULL, NULL, 'upload/services/168197625715.jpg', '2023-04-20 07:35:30', '2023-04-20 07:37:37'),
(12, 'Pet Photography', 'pet-photography', NULL, '<p>Our Pet Photography package is the perfect way to capture the unique personality and spirit of your beloved pet. Our experienced and professional pet photographer will work with you to create a customized photo shoot that will showcase your pet\'s best features and characteristics.</p><p>Our package has options to choose photo shoot in studio, at your home or a location of your choice, where your pet will feel comfortable and at ease. During the shoot, our photographer will take a variety of candid and posed shots of your pet, capturing their playful, loving and relaxed moments. We will also take some portrait shots, where your pet\'s true essence will be captured in a stunning way.</p><p>After the photo shoot, you will receive a digital gallery of high-resolution images from which you can choose your favorite shots.&nbsp;</p><p>In addition to the traditional print options, we also offer a range of unique products to showcase your pet\'s photos such as wall art, albums, and custom-designed frames. These will allow you to display your pet\'s photos in a way that will complement any room in your home.</p><p>Our pet photography package is not only for pet owners, it can also be a great gift for a friend or family member who has a special bond with their pet. We believe that every pet is unique and deserves to be captured in a way that reflects their special character, and we strive to provide that in our package.</p><p>Book our Pet Photography package today and treasure the memories of your pet forever.<br></p>', 'upload/services/168197618013.jpg', '2023-04-20 07:36:20', '2023-04-20 09:49:28'),
(13, 'Photobooth', 'photobooth', NULL, '<p>We provide top-notch photo booth experiences for events of all sizes. Our services include setup, props, and on-site attendants to ensure a seamless experience for you and your guests. We offer three different packages to cater to different budgets and event sizes.</p><p>Our Basic package includes 2 hours of service, props, and instant printouts of the photos taken. Our Premium package includes 4 hours of service, props, instant printouts and a digital copy of all the photos taken for you to keep. Our Elite package includes an additional add-on of social media integration, where your guests can instantly share the photos on their social media profiles.<br></p>', 'upload/services/168197661311.jpg', '2023-04-20 07:43:33', '2023-04-20 10:05:15'),
(14, 'Birthday Shoot', 'birthday-shoot', NULL, '<p>Kids| Adult</p>', 'upload/services/168197668738.jpg', '2023-04-20 07:44:47', '2023-04-20 07:44:47'),
(15, 'Model Portfolio', 'model-portfolio', NULL, '<p>A professional model photoshoot is an important step in building a successful modeling career. The photographs taken during a shoot can be used to showcase a model\'s unique look and versatility, and to attract the attention of potential clients and agents.</p><p>During a professional model photoshoot, the model will work closely with a photographer to capture a variety of looks and poses. The photographer will work to bring out the model\'s best features and create images that are both visually striking and represent the model\'s unique personality and style.</p><p>Before a photoshoot, a model should come prepared with a variety of clothing options and poses in mind. It\'s also important to be open to the photographer\'s direction and to have a professional attitude throughout the shoot. During the shoot, the model should be ready to work hard, to take direction and most importantly to have fun.</p><p>After the photoshoot, the model will receive a selection of final images that can be used in their portfolio, on social media, and to attract potential clients and agents. These images will be edited and retouch, to remove any blemishes and to enhance the overall look of the final images.</p><p>Overall, a professional model photoshoot is a valuable investment for any model looking to build a successful career. It gives the opportunity to showcase their unique look, versatility and also to work with experienced photographers and makeup artists who can help bring out the best in the model and make them shine.<br></p>', 'upload/services/168197679511.jpg', '2023-04-20 07:45:20', '2023-04-20 11:27:03'),
(16, 'Graduation Shoot', 'graduation-shoot', NULL, NULL, 'upload/services/168197675836.jpg', '2023-04-20 07:45:59', '2023-04-20 07:45:59');
