(7, 'about_our_approach', 'We believe that everyone has a unique and beautiful story to tell, and our goal is to capture those  stories in a way that is both natural and visually striking. We believe in capturing real emotion, real connection and real beauty. We\'re not just interested in making great photos but also in creating  an experience that makes you feel comfortable and empowered.', '2023-03-17 01:57:14', '2023-03-28 23:22:27', NULL),
(8, 'about_our_experience', 'We\'ve been in the photography business for more than 15 years, and have developed a keen eye for capturing special moments and unique perspectives. We have been trained in various photography techniques and technologies.', '2023-03-17 01:57:20', '2023-03-28 23:23:08', NULL),
(9, 'about_portfolio', 'Check out our portfolio to see some examples of our work. We have a diverse collection of images that showcase our skills, including portraits, family photos, and lifestyle shots.', '2023-03-17 01:57:27', '2023-03-28 23:23:49', NULL),
(10, 'registration_form_email', NULL, '2023-03-17 18:03:01', '2023-03-17 18:03:01', NULL),
(11, 'contact_form_email', 'info@strapstudios.com', '2023-03-17 18:03:26', '2023-03-28 23:16:50', NULL),
(12, 'workshop_header_title', 'Workshops', '2023-03-31 11:27:19', '2023-03-31 11:27:19', NULL),
(13, 'workshop_header_description', 'Photography courses are a great way for individuals to learn or improve their photography skills. Whether you are a beginner or an experienced photographer, there are courses available to suit your needs. With a focus on techniques such as camera operation, lighting, composition, and post-processing, photography courses will help individuals capture stunning photographs in any setting.', '2023-03-31 11:27:19', '2023-05-02 05:21:49', NULL),
(14, 'about_studio_rental', 'Our Studio Rental package is the perfect solution for photographers, videographers, and other visual artists looking for a professional space to create their next project. Our studio is fully equipped with equipment and amenities, providing you with everything you need to bring your vision to life. Our studio rental package includes the use of our spacious and well-lit shooting area, which is perfect for photography and videography projects of all types. The studio features a range of backgrounds, including solid colors, as well as a variety of lighting options to suit your needs. The studio also has a makeup and hair area, a comfortable waiting area, and a kitchenette. We also provide studio equipment s, lighting equipment, and other accessories, all included in the package price. This saves you the time, money and hassle of having to rent or transport your own equipment. Our studio rental package is flexible, allowing you to rent the space by the hour, half-day or full-day, depending on your project\'s needs. We also offer discounted rates for multiple days or extended rentals, making it easy and affordable for you to work on larger projects. Additionally, our studio rental package is ideal for workshops, photography classes, and other events, as the space can be easily configured to accommodate up to 20 attendees. Book our Studio Rental package and experience the convenience and flexibility of having a professional space to create your next project. With our package, you can focus on your creativity without worrying about the logistics of finding a suitable location and equipment.', '2023-04-20 11:15:38', '2023-04-28 12:24:00', NULL);
