(6, 'Photography 101 (PASM)', 'photography-101-pasm', NULL, '3 hours Session', '625', NULL, '<p>Photography 101 is a beginner\'s course that teaches the basics of photography. It covers topics such as the exposure triangle (aperture, shutter speed, and ISO), composition, lighting, and camera settings. Students will learn how to use their cameras, how to take well-exposed and well-composed photos.. They will also learn about the different types of photography such as portrait, landscape, and street photography. This course is designed for those with little or no prior photography experience and will provide a solid foundation for further study in the field.</p>', '<ul>\r\n<li>How cameras work</li>\r\n<li>Camera controls and functions</li>\r\n<li>Lenses</li>\r\n<li>Filters &amp; Accessories</li>\r\n<li>The importance of light</li>\r\n<li>Using shutter speed to control motion</li>\r\n<li>Using aperture to control depth of field</li>\r\n<li>White balance</li>\r\n<li>Basic composition techniques</li>\r\n</ul>', '<ul>\r\n<li>Don&rsquo;t forget to bring your camera, lenses, tripod, charged batteries, and memory cards.</li>\r\n<li>We recommend that you have a DSLR camera or an advanced point and shoot camera with shutter priority and aperture priority modes.</li>\r\n<li>You can also rent a Canon basic DSLR camera with lens during the workshop for AED 50/ camera.</li>\r\n</ul>', '2023-04-04 10:26:26', '2023-04-04 10:32:54'),
(7, 'Photography 102 (Manual Exposure)', 'photography-102-manual-exposure', NULL, '3 hours Session', '625', NULL, '<p>Photography 102 is a continuation of Photography 101, building on the concepts and skills learned in the first course. This workshop is designed to get you familiar with the manual exposure mode on your camera so you can take complete control of your camera and be independent of automatic and semi-automatic modes. This workshop teaches the fundamentals of shutter speed, aperture, and ISO, and how they work together and balance each other to achieve a properly exposed image. You will learn how to adjust each of these functions independently and use your camera&rsquo;s built-in light meter to properly balance them for an optimal exposure. If you have already taken our Introduction to&nbsp;Photography 101&nbsp;Workshop, this class is the perfect follow up and will include some review and a lot of new information to get you moving forward in your photographic journey. This is a content rich class, so we recommend bringing a notebook and a pen.</p>', '<ul>\r\n<li>The DSLR camera &amp; recommended accessories</li>\r\n<li>Viewfinder features</li>\r\n<li>Understanding manual exposure</li>\r\n<li>Metering light to achieve a proper exposure</li>\r\n<li>Shutter, Aperture, and ISO in depth</li>\r\n<li>Controlling motion and depth of field</li>\r\n<li>White Balance</li>\r\n<li>Focus controls</li>\r\n</ul>', '<ul>\r\n<li>Don&rsquo;t forget to bring your camera, lenses, tripod, charged batteries, and memory cards.</li>\r\n<li>We recommend that you have a DSLR camera or an advanced point and shoot camera with shutter priority and aperture priority modes.</li>\r\n<li>You can also rent a Canon basic DSLR camera with lens during the workshop for AED 50/ camera.</li>\r\n</ul>', '2023-04-04 10:31:42', '2023-04-04 10:33:04'),
(8, 'Photography  (101 and 102)', 'photography-101-and-102', NULL, 'Duration : 2 weeks (Monday and Wednesday) Timings: 2 hours (2:00- 4:00pm)', '1500', NULL, '<p>This is an extended courses for students who wish to combine the two courses. It covers topics such as the exposure triangle (aperture, shutter speed, and ISO), composition, lighting, and camera settings. Students will learn how to use their cameras, how to take well-exposed and well-composed photos.. They will also learn about the different types of photography such as portrait, landscape, and street photography. This course is designed for those with little or no prior photography experience and will provide a solid foundation. You will also learn fundamentals of shutter speed, aperture, and ISO, and how they work together and balance each other to achieve a properly exposed image. You will learn how to adjust each of these functions independently and use your camera&rsquo;s built-in light meter to properly balance them for an optimal exposure. If you have already taken our Introduction to&nbsp;Photography 101&nbsp;Workshop, this class is the perfect follow up and will include some review and a lot of new information to get you moving forward in your photographic journey. This is a content rich class, so we recommend bringing a notebook and a pen.</p>', '<ul>\r\n<li>How cameras work</li>\r\n<li>Camera controls and functions</li>\r\n<li>Lenses</li>\r\n<li>Filters &amp; Accessories</li>\r\n<li>The importance of light</li>\r\n<li>Using shutter speed to control motion</li>\r\n<li>Using aperture to control depth of field</li>\r\n<li>White balance</li>\r\n<li>Basic composition techniques</li>\r\n<li>The DSLR camera &amp; recommended accessories</li>\r\n<li>Viewfinder features</li>\r\n<li>Understanding manual exposure</li>\r\n<li>Metering light to achieve a proper exposure</li>\r\n<li>Shutter, Aperture, and ISO in depth</li>\r\n<li>Controlling motion and depth of field</li>\r\n<li>White Balance</li>\r\n<li>Focus controls</li>\r\n</ul>', NULL, '2023-04-04 10:53:52', '2023-04-04 10:53:52'),
(9, 'Studio Lighting 101', 'studio-lighting-101', NULL, '2 hours Session', '625', NULL, '<p>During a studio lighting workshop, participants will learn about different types of lighting equipment, including strobe lights, continuous lights, and reflectors. They will also learn how to control light using various modifiers, such as softboxes, umbrellas, and beauty dishes.</p>\r\n<p>Participants will also learn about different lighting setups and techniques, such as key, fill, and back lighting, as well as how to create different moods and effects using color gels and light shaping tools.</p>\r\n<p>In addition to learning about the technical aspects of studio lighting, participants will also have the opportunity to practice their skills through hands-on exercises and assignments. This may include working with models or still life subjects to create a variety of lighting setups and test different techniques.</p>\r\n<p>Overall, a studio lighting workshop is a great opportunity for photographers to learn from experienced professionals and practice their skills in a controlled environment. It is a great way to improve the overall quality of your photographs and take your photography to the next level.</p>\r\n<p>Students must bring their own DSLR camera, lenses (50mm or higher is recommended), fully charged batteries, memory cards, and a notebook &amp; pen to take notes.</p>\r\n<p>If you do not have a good grasp of the manual DSLR settings, it is recommended that you attend the Photography 102 before attending this workshop.</p>', '<ul>\r\n<li>Studio Lights</li>\r\n<li>Light Setup</li>\r\n<li>Speedlights &amp; Light modifiers (umbrellas, soft-boxes, e.t.c)</li>\r\n<li>Light Shapers (Reflectors, Snots, Beauty Dishes, e.t.c)</li>\r\n<li>Light Techniques (Rembrandt, Loop ,Butterfly, split, Short, Broad, Flat, Clamshell, High-key and Low-key lighting)</li>\r\n<li>Camera settings to sync with light setup</li>\r\n<li>Studio light metering</li>\r\n<li>Cable and wireless sync for strobes</li>\r\n<li>Lighting white balance</li>\r\n<li>Lighting tips &amp; tricks</li>\r\n</ul>', NULL, '2023-04-04 10:59:15', '2023-04-04 10:59:15'),
(10, 'Indoor Portrait Workshop', 'indoor-portrait-workshop', NULL, '2 hours Session', '625', NULL, '<p>During an indoor portrait workshop, participants will learn about different lighting setups, equipment, and techniques for creating flattering and dynamic portraits. They will learn how to use different types of lighting equipment, including strobe lights, continuous lights, and reflectors, to control the light and create different moods and effects.</p>\r\n<p>Participants will also learn about posing and composition techniques for portraits, including how to flatter the subject and create dynamic compositions. They will also learn about the use of color and backgrounds in indoor portrait photography.</p>\r\n<p>In addition to learning about the technical aspects of indoor portrait photography, participants will also have the opportunity to practice their skills through hands-on exercises and assignments. This may include working with models or still life subjects to create a variety of lighting setups and test different techniques.</p>\r\n<p>Overall, an indoor portrait workshop is a great opportunity for photographers to learn from experienced professionals and practice their skills in a controlled environment. It is a great way to improve the overall quality of your portrait photographs and take your photography to the next level.</p>', '<ul>\r\n<li>Indoor lighting terminology</li>\r\n<li>Studio equipment</li>\r\n<li>Strobe lighting</li>\r\n<li>Speedlights &amp; light modifiers (umbrellas, soft-boxes, etc.)</li>\r\n<li>Reflectors</li>\r\n<li>Camera settings for indoor lighting</li>\r\n<li>Studio light metering</li>\r\n<li>Cable and wireless sync for strobes</li>\r\n<li>Indoor/Studio lighting white balance</li>\r\n<li>Light setups for 1, 2, and 3 light portraits</li>\r\n<li>Lighting tips &amp; tricks</li>\r\n</ul>', NULL, '2023-04-04 11:02:39', '2023-04-04 11:02:39'),
(11, 'Outdoor Portraits Workshop', 'outdoor-portraits-workshop', NULL, '2 hours Session', '625', NULL, '<p>An outdoor portrait workshop is a training session that focuses on the art and technique of taking portraits in natural or outdoor settings. These workshop are designed for amateur and professional photographers looking to improve their portrait photography skills.</p>\r\n<p>During an outdoor portrait workshop, participants will learn about different lighting setups, equipment, and techniques for creating flattering and dynamic portraits in outdoor settings. They will learn how to use natural light and reflectors to control the light and create different moods and effects. They will also learn about the use of flash, and how to balance it with ambient light to achieve the desired result.</p>\r\n<p>Participants will also learn about posing and composition techniques for outdoor portraits, including how to flatter the subject and create dynamic compositions. They will also learn about the use of color and backgrounds in outdoor portrait photography, as well as how to work with different weather conditions and times of day to achieve the desired result.</p>\r\n<p>Overall, an outdoor portrait workshop is a great opportunity for photographers to learn from experienced professionals and practice their skills in a natural environment. It is a great way to improve the overall quality of your portrait photographs and take your photography to the next level.</p>', '<ul>\r\n<li>Outdoor lighting terminology</li>\r\n<li>Lighting equipment</li>\r\n<li>Strobe lighting</li>\r\n<li>Speed-lights &amp; Light modifiers (umbrellas, soft-boxes, etc.)</li>\r\n<li>Reflectors</li>\r\n<li>Camera settings for outdoor lighting</li>\r\n<li>Light metering</li>\r\n<li>Cable and wireless sync for strobes</li>\r\n<li>Outdoor lighting white balance</li>\r\n<li>Light setups for 1, 2, and 3 light portraits</li>\r\n<li>Lighting tips &amp; tricks</li>\r\n</ul>', NULL, '2023-04-04 11:10:38', '2023-04-04 11:10:38'),
(12, 'Intro to Photoshop Retouching', 'intro-to-photoshop-retouching', NULL, '2 hours Session', '625', NULL, '<p>An Introduction to Photoshop Retouching course is a training session that focuses on teaching the basic techniques and tools used in Adobe Photoshop for retouching and editing photographs. These course is designed for amateur and professional photographers, as well as anyone interested in learning how to edit and retouch photographs.</p>\r\n<p>During an Introduction to Photoshop Retouching course, participants will learn about the basic tools and interface of Adobe Photoshop, including how to navigate the program and use essential tools such as the Layers panel, the Brush tool, and the Clone Stamp tool. They will learn how to make basic adjustments to an image, such as adjusting the brightness and contrast, color balance, and sharpness.</p>\r\n<p>Participants will also learn about more advanced retouching techniques, such as how to remove blemishes, smoothen skin, and adjust hair and clothing. They will learn about how to use layer masks and how to work with selections.</p>\r\n<p>In addition to learning about the technical aspects of retouching and editing photographs, participants will also have the opportunity to practice their skills through hands-on exercises and assignments. This may include editing and retouching their own photographs, as well as working with sample images provided by the instructor.</p>\r\n<p>Overall, an Introduction to Photoshop Retouching course is a great opportunity for anyone interested in learning how to edit and retouch photographs using Adobe Photoshop. It is a great way to improve the overall quality of your photographs and take your editing skills to the next level.</p>\r\n<p>Students must bring their laptop with the Adobe Photoshop software installed. Your instructor will advice you on the installation process once you booked the session.</p>', '<ul>\r\n<li>Setting the Photoshop Color and Preferences</li>\r\n<li>Using Basics Photoshop Tools:</li>\r\n<li>Selection Tools</li>\r\n<li>Layer Mask</li>\r\n<li>Brushes</li>\r\n<li>Healing and Clone tools</li>\r\n<li>Adjustment Layer and Filters</li>\r\n<li>Basic Landscape Editing</li>\r\n</ul>', NULL, '2023-04-04 11:14:47', '2023-04-04 11:14:47'),
(13, 'Photo Processing and Enhancement', 'photo-processing-and-enhancement', NULL, 'Duration : 2 weeks-2 days (Friday and Saturday) Timings: 3 hours each session (3:00pm - 6:00pm) upto 10 pax/ session', '2900', NULL, '<p>A Photo Processing and Enhancement course is a class that teaches students the various techniques and methods used to improve the quality and appearance of digital photographs. The course may cover topics such as image editing software, color correction, exposure adjustment, and image compositing.</p>\r\n<p>Students will learn how to use software such as Adobe Photoshop and Lightroom to edit and enhance their photographs. They will learn how to adjust the brightness, contrast, and color balance of an image, as well as how to remove unwanted elements and fix common problems such as red-eye and lens distortion.</p>\r\n<p>The course may also cover advanced topics such as high dynamic range (HDR) photography and panoramic image stitching. HDR photography involves merging multiple images of the same scene taken at different exposures to create an image with a wider dynamic range, which can result in more details in both the shadows and highlights. Panoramic image stitching is the process of combining multiple photos taken at different angles to create a single, wide-angle image.</p>\r\n<p>Throughout the course, students will have the opportunity to practice their skills through hands-on assignments and projects. They will also receive feedback on their work.</p>\r\n<p>Overall, a Photo Processing and Enhancement course is a great way for photographers and photography enthusiasts to improve their skills and take their photographs to the next level.</p>\r\n<p>Students must bring their laptop with the Adobe Photoshop software installed. Basic knowledge of Adobe Photoshop is an added advantage.</p>', NULL, NULL, '2023-04-04 11:19:45', '2023-04-04 11:19:45');
